package com.sic.pdm.vo.bascket;

public class BascketVo {

	private String onum;
	private String id;
	private String store;
	private String odate;
	private String roadaddr;
	private String addr;
	private String deliveryselect;
	private String ostate;
	private String icode;
	private String mcode;
	private String iname;
	private String odnum;
	private String odstock;
	private String oprice;
	
	public BascketVo() {
		// TODO Auto-generated constructor stub
	}
	
	public BascketVo(String onum, String id, String store, String odate, String roadaddr, String addr,
			String deliveryselect, String ostate) {
		super();
		this.onum = onum;
		this.id = id;
		this.store = store;
		this.odate = odate;
		this.roadaddr = roadaddr;
		this.addr = addr;
		this.deliveryselect = deliveryselect;
		this.ostate = ostate;
	}


	public String getOnum() {
		return onum;
	}


	public void setOnum(String onum) {
		this.onum = onum;
	}


	public String getId() {
		return id;
	}


	public void setId(String id) {
		this.id = id;
	}


	public String getStore() {
		return store;
	}


	public void setStore(String store) {
		this.store = store;
	}


	public String getOdate() {
		return odate;
	}


	public void setOdate(String odate) {
		this.odate = odate;
	}


	public String getRoadaddr() {
		return roadaddr;
	}


	public void setRoadaddr(String roadaddr) {
		this.roadaddr = roadaddr;
	}


	public String getAddr() {
		return addr;
	}


	public void setAddr(String addr) {
		this.addr = addr;
	}


	public String getDeliveryselect() {
		return deliveryselect;
	}


	public void setDeliveryselect(String deliveryselect) {
		this.deliveryselect = deliveryselect;
	}


	public String getOstate() {
		return ostate;
	}


	public void setOstate(String ostate) {
		this.ostate = ostate;
	}


	public String getIcode() {
		return icode;
	}


	public void setIcode(String icode) {
		this.icode = icode;
	}


	public String getMcode() {
		return mcode;
	}


	public void setMcode(String mcode) {
		this.mcode = mcode;
	}


	public String getIname() {
		return iname;
	}


	public void setIname(String iname) {
		this.iname = iname;
	}


	public String getOdnum() {
		return odnum;
	}


	public void setOdnum(String odnum) {
		this.odnum = odnum;
	}


	public String getOdstock() {
		return odstock;
	}


	public void setOdstock(String odstock) {
		this.odstock = odstock;
	}


	public String getOprice() {
		return oprice;
	}


	public void setOprice(String oprice) {
		this.oprice = oprice;
	}
	
	
	
	
	
}
